import React from "react";
import "./Forecast.css";

class Forecast extends React.Component {
  render() {
    return (
      <div className="forecast__container">
        {this.props.forecastOneDay && <div>OneDayForecast: { this.props.forecastOneDay }</div>}
        {this.props.forecastToDay && <div>OneDayForecast: { this.props.forecastOneDay }</div>}
        {this.props.forecastOneDay && <div>OneDayForecast: { this.props.forecastOneDay }</div>}
        {this.props.forecastOneDay && <div>OneDayForecast: { this.props.forecastOneDay }</div>}
        {this.props.forecastOneDay && <div>OneDayForecast: { this.props.forecastOneDay }</div>}
      </div>
    )
  }
}

export default Forecast;
